    false,nt"url": null,nt"notes": "Summary of the whooping crane tracking
    project for fall 1975 to spring 1989.  The Project involves the following activities:
    (a) distribution of Preu00adMigration Notices to cooperators, which contain a list
    of the key and alternate State and Federal contacts in each State, a sighting report
    form, and color-band information; (b) weekly notification of key contacts regarding
    the status of the migration; (c) arrangement for the completion of a site evaluation
    at each confirmed sighting location; (d) distribution of a migration summary to
    cooperators following each migration; and (e) maintenance of all confirmed sightings,
    color-marked bird observations, and site evaluations on a computer database.",nt"license_title":
